import DateFormat from "./dateFormat";

const filterByTime = (data) => {
  const sortDates = (a, b) => {
    return DateFormat(a.date_posted) - DateFormat(b.date_posted);
  };
  data.sort(sortDates);

  return data;
};

export { filterByTime };
